class HeaderContainer extends React.Component {
  componentDidMount() {
    this.props.LogedIn();
  }

  render() {
    return <Header {...this.props} />;
  }
}

const mapStateToProps = (state) => ({
  isAuth: state.auth.isAuth,
  login: state.auth.login,
});

export default connect(mapStateToProps, {
  setUserData,
  setIsFetching,
  LogedIn,
  logout
})(HeaderContainer);
